import { Button, ButtonGroup } from '@mui/material';
import { FilledRectangle, StrokeRectangle } from '@TheArtist/TheCanvas';
import { useEffect, useRef } from 'react';
import { ColorPallete } from './color';
const BUFFER = 6;
interface PiArtProps {
  height: number;
  width: number;
  border: string;
}
export const PiArt = (props: PiArtProps) => {
  const canvas = useRef<HTMLCanvasElement | null>(null);
  let pi =
    '3141592653589793238462643383279502884197169399375105820974944592307816406286208998628' +
    '' +
    '' +
    '' +
    '' +
    '' +
    '' +
    '' +
    '' +
    '' +
    '' +
    '3784297757265172087724474095226716630600546971638794317119687348468873818665675127929857501636341131462753049901913564682380432997069577015078933772865803571279091376742080565549362541';
  useEffect(() => {
    let arr = pi.split('');
    console.log(pi.length);
    console.log(arr.length);
    let ctx = canvas.current?.getContext('2d');

    let current = 0;
    let last = 0;
    let y = 0;
    let colorPallete = ColorPallete[getRandomInt(0, ColorPallete.length)];
    if (ctx) {
      FilledRectangle(
        ctx,
        0,
        0,
        props.height,
        props.width,
        // colorPallete[getRandomInt(0, colorPallete.length)]
        getRandomColor()
      );
    }
    // let color = hexToRGB(colorPallete[getRandomInt(0, colorPallete.length)]);
    let max = 0;
    arr.forEach((val) => {
      // console.log(val);
      current = +val * BUFFER;
      if (last >= props.width) {
        last = 0;
        y += max * BUFFER;
        max = 0;
      }
      //   if (ctx) StrokeRectangle(ctx, last, y, 20, current, hexToRGB(colorPallete[getRandomInt(0, colorPallete.length)]));
      //   if (ctx) FilledRectangle(ctx, last, y, 20, current, hexToRGB(colorPallete[getRandomInt(0, colorPallete.length)]));
      if (ctx)
        FilledRectangle(ctx, last, y, current, current, getRandomColor());
      if (ctx)
        StrokeRectangle(ctx, last, y, current, current, getRandomColor());
      if (ctx) {
          ctx.font = '30px Verdana';
          ctx.fillStyle = "rgba(0,0,0, .3)"
        ctx.fillText(val, last, y+30);
      }
      last += +val * BUFFER;
      if (+val > max) max = +val;
    });
  }, []);

  const getRandomInt = (min: number, max: number) => {
    min = Math.ceil(min);
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min) + min); //The maximum is exclusive and the minimum is inclusive
  };

  function getRandomSolidColor() {
    var letters = '0123456789ABCDEF';
    var color = '#';
    for (var i = 0; i < 6; i++) {
      color += letters[Math.floor(Math.random() * 16)];
    }
    return color;
  }

  function hexToRGB(h: string) {
    let r = '0',
      g = '0',
      b = '0',
      a = '0';

    // 3 digits
    if (h.length == 4) {
      r = '0x' + h[1] + h[1];
      g = '0x' + h[2] + h[2];
      b = '0x' + h[3] + h[3];

      // 6 digits
    } else if (h.length == 7) {
      r = '0x' + h[1] + h[2];
      g = '0x' + h[3] + h[4];
      b = '0x' + h[5] + h[6];
    }
    a = Math.random().toFixed(1);

    return 'rgba(' + +r + ',' + +g + ',' + +b + ',' + a + ')';
  }

  function getRandomColor() {
    var o = Math.round,
      r = Math.random,
      s = 255;
    return (
      'rgba(' +
      o(r() * s) +
      ',' +
      o(r() * s) +
      ',' +
      o(r() * s) +
      ',' +
      r().toFixed(1) +
      ')'
    );
  }

  const handlePrint = () => {
    const dataURL = canvas.current?.toDataURL('image/png', 1.0);
    var link = document.createElement('a');
    link.download = 'TheArtist.png';
    link.href = dataURL || '';
    link.click();
  };

  return (
    <>
      <ButtonGroup
        variant="contained"
        aria-label="outlined primary button group"
      >
        <Button onClick={handlePrint}>Print Art</Button>
      </ButtonGroup>
      <canvas
        ref={canvas}
        style={{ objectFit: 'contain' }}
        width={props.width}
        height={props.height}
      ></canvas>
    </>
  );
};
